import React from 'react';
import {Button} from 'react-bootstrap'



const Buttons = () => {


    return (


        <div className="container-fluid">
            <div className="row justify-content-center">
               <div className="col-md-7">
               <Button variant="info" className="homeButton" style="fontWeight:'bold'">Inventory</Button>
               <Button variant="info" className="homeButton">Suppliers</Button>
               <Button variant="info" className="homeButton">Stats</Button>
               </div>
               <div className="col-md-7">
               <Button variant="info" className="homeButton1">Add New Item</Button>
               <Button variant="info" className="homeButton1">Add New Supplier</Button>
               <Button variant="info" className="homeButton1">Info</Button>
               </div>
            </div>
        </div>


    );





}

export default Buttons;
